import React, { Component } from 'react';
import './titre1.css';

class Titre1 extends Component {
  render() {
    const titre1 = this.props.titre1;

    return (
      <div className="title1">
        <p>{titre1}</p>
      </div>
    );
  }
}

export default Titre1;
